  [],\n\t\"num_tags\": 0,\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-casts-aboard-rude-as-part-of-project-opr-h320-ru-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130303 includes physical
  and profile data collected aboard NOAA Ship RUDE during project OPR-H320-RU-06 in
  the North Atlantic Ocean from 2006-04-21 to 2007-05-28. These data include SOUND
